import Layout from '../components/layout/Layout';
import { SimpleGrid, Box, Heading } from '@chakra-ui/core';

export const Live = (props) => {
  return (
    <Layout>
      <SimpleGrid columns={[1, 2, 2]} spacing='40px'>
        <Box>
          <Box w='100%' h='400px' bg='black'></Box>
          <Heading>a</Heading>
        </Box>

        <Box>Preguntas</Box>
      </SimpleGrid>
    </Layout>
  );
};
export default Live;
